        <div className = "Container">
           <div className = "Color_Tag" >
            Color
           </div>
           <div className = "Style_guide_Tag">
           style guide
          </div>
          <div className = "Primary-color" >
          Primary-color
          </div>
        </div>
    );
};

export default Color;
